window.bookSummaryJSON = "<p>A waft of gardenia and bay leaf fills your senses, and a rising guitar arpeggio balanced by languid horns and metallic guitar strings give a sense of unfolding to the day.&nbsp;&nbsp;&nbsp;</p> <p>Our morning music tracks were created to help you start your day on the right foot but can be enjoyed any time of day. They're both contemplative and energizing and help to create a positive atmosphere whenever you're looking for an energy shift.&nbsp;&nbsp;</p> <p>Sean Cronin is a composer and multi-instrumentalist whose work spans jazz, country, punk, classical, folk, early rock ’n’ roll, experimental, and theatrical music genres. He’s toured internationally, led several bands, and acted and performed with Chelsea Hotel: Songs of Leonard Cohen. Sean has been the recipient of the Grand Prix du Jazz at the Montreal International Jazz Festival, and his score for <i>Kill Me Like You Mean It</i> was nominated for a Drama Desk Award in 2015.&nbsp;&nbsp;</p> <p>This title is part of the Audible Sleep Collection, exclusive audio experiences created to help you fall asleep, stay asleep, and wake up in the right morning mindset. New and free for members.&nbsp;&nbsp;</p> <p>Sean Cronin: piano, upright bass, keyboards, guitar, cello, bass drum&nbsp;</p> <p>Clara Kennedy: cello&nbsp;</p> <p>Joe MacDonough: trombone</p>"; 
